import React, {Component} from 'react';
import Blogposts from './Blogposts';

class Blog extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id: null
        }
    }

    componentDidMount() {
        let id = this.props.match.params.blog_id;
        this.setState({
            id: id,
        })
    }
    
    render() {
        const { id } = this.state;
        if (id) {
            return (
                <div className="blogs">
                    <h1>Why do we wake up early?</h1>
                </div>
            )
        }
    }
}

export default Blog;
